import React from "react";
import { Link } from "react-router-dom";
const Menu = () => {
  return (
    <>
      <NavLink to="/">about</NavLink>
      <NavLink to="/contact">contact</NavLink>
      <br />
      <a href="/">about</a>;<a href="/contact">contact</a>;
    </>
  );
};
export default Menu;
